import React from 'react';
import styled from 'styled-components';
import Illustration from './Illustration';

const TallContainer = styled.div`
  height: 60vh;
  display: block;
`;

const AboutPanelContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
  margin: 0px auto;
  max-width: 1000px;

  @media (max-width: 48em) {
    display: block;
    max-width: 500px;
  }
`;

const AboutPanelTextContainer = styled.div`
  flex: 1;
  max-width: 450px;
`;

const AboutPanelTitle = styled.p`
  font-size: 20px;
  margin-top: 66px;
  font-weight: 400;
`;

export default function ContactPanel() {
  return (
    <TallContainer>
      <AboutPanelContainer>
        <Illustration />
        <AboutPanelTextContainer>
          <AboutPanelTitle>Get In Touch</AboutPanelTitle>
          <ul>
            <li>
              <i class='fas fa-file'></i>
              <a
                href='https://drive.google.com/file/d/13PLzwQ_L7DixClIIPclUCYdomKWClo0-/view'
                Resume
              />
            </li>
            <li>
              <i class='fab fa-linkedin-in'></i>
              <a
                href='https://www.linkedin.com/in/noah-cook-6b4054148/'
                Linkedin
              />
            </li>
            <li>
              <i class='fas fa-file'></i> Email
            </li>
          </ul>
        </AboutPanelTextContainer>
      </AboutPanelContainer>
    </TallContainer>
  );
}

